import React from 'react'
import ImgFrame from "./ImgFrame"

function Column(){
    return(
        <div>
            {images.map(()=>{
                <ImgFrame  key={1} src={img.src} h={img.height} author={img.author}/>
            })}

        </div>
    )
}

export default Column
